import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.net.URL;
import java.security.MessageDigest;
//this File checks the server Auth Key to Validate that the Software
//is not stolen.
//Implemented by Elycin of Node Software

public class Essential_CheckServerAuthKey {
	public static void main(String[] args) throws Throwable {
		URL retrievehash = new URL("http://dl.dropbox.com/u/36959158/trimity/TrimityServerAuthKey.txt");
		BufferedReader in = new BufferedReader(new InputStreamReader(
		                retrievehash.openStream()));

		String encryptedhash = in.readLine();
		String PendingHash = "";
		//Convert
		MessageDigest md = MessageDigest.getInstance("SHA-512");
        md.update(PendingHash.getBytes());
 
        byte byteData[] = md.digest();
 
        //convert the byte to hex format method 1
        StringBuffer sb = new StringBuffer();
        for (int i = 0; i < byteData.length; i++) {
         sb.append(Integer.toString((byteData[i] & 0xff) + 0x100, 16).substring(1));
        }
 
        //System.out.println("Hex format : " + sb.toString());
 
        //convert the byte to hex format method 2
        StringBuffer hexString = new StringBuffer();
    	for (int i=0;i<byteData.length;i++) {
    		String hex=Integer.toHexString(0xff & byteData[i]);
   	     	if(hex.length()==1) hexString.append('0');
   	     	hexString.append(hex);
    	}
    	String converttruehash = hexString.toString();
    if (converttruehash.contains(encryptedhash.toString())){
    		System.err.println("This Server is using the TRUE Encrypted Hash. Starting.");
    		
    		
    		
    	} else {
    		System.err.println("[ERROR][CheckServerAuthKey]Hash Keys do not match up.");
    		System.err.println("[ERROR][CheckServerAuthKey]This Server is Stolen or Outdated.");
    		System.exit(1);
    	}
    	
		
		
		
	}
}
